import Vue from 'vue'
import Router from 'vue-router'

 const login = r => require.ensure([], () => r(require('../views/my/login')), 'login')

Vue.use(Router)

export default new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes: [
    {
      path: '/',
      name: 'home',
      component: login
    },
    {
      path: '/login',
      name: 'login',
      component: login
    }
  ]
})
